  function handleClick() {
      alert('You clicked me!');
  }
  return (
      <div>
          <AddSpace/>
          <button onClick={handleClick} type='button'>
              Add
          </button>
      </div>


  )
}





function App() {
  return (
    <div className="App">
      <h1>TODO LIST</h1>
      <ButtonAdd/>
      <TabPanel/>
    </div>
  );
}

export default App;
